🦒🏭
São muitas as possibilidades de se usar a empatia no meio corporativo e fora dele. Algumas empresas manipulam os desejos de seus clientes e utilizam a empatia apenas como marketing, pois são motivadas apenas pelo lucro financeiro. Existem aquelas que buscam compreender a mente das pessoas para o próprio benefício financeiro, e outras que usam métodos empáticos para melhorar a qualidade de vida das pessoas através da tentativa de compreender e satisfazer a necessidades.
🦒🏭
As empresas que usam a empatia visando o bem estar de seus clientes têm grandes possibilidades. São capazes de desenvolver um espírito criativo e de se tornarem mais sustentáveis. 
🦒🏭
A visão do mundo de outra pessoa, compartilhando inclusive a sua própria visão trazem perspectivas diferentes e agregam uma postura visionária e diferenciada. Calçar os sapatos de outra pessoa para compreender como ela se sente, surgem novos pensamentos e desenvolve a criatividade.
🦒🏭
Hoje ainda são poucas as empresas que se utilizam da empatia com objetivo de atender honestamente as reais necessidades de seus clientes. Desenvolver a empatia assertiva é um trabalho que beneficia a todos os setores de uma empresa, não importando o tamanho. 
🦒🏭
Por onde começar a exercer a empatia então? A Empatia para ser exercida, deve-se começar pela autoempatia.  Sem esse elemento nos faltarão os fundamentos psicológicos para se conectar ao outro. É a ideia essencial de ser bom para si mesmo em situações muito difíceis.  Desenvolver essa autoempatia e atender suas próprias necessidades são os primeiros passos para se atingir a empatia. 
🦒🏭
A empatia pode enfrentar crises, transformar e agregar setores. Vamos construir empaticamente? Vamos construir diálogos?
🦒🏭
